utoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"522356","type":"CustomJS"},{"attributes":{"coordinates":null,"data_source":{"id":"522025"},"glyph":{"id":"522027"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"522029"},"nonselection_glyph":{"id":"522028"},"view":{"id":"522031"}},"id":"522030","type":"GlyphRenderer"},{"attributes":{"coordinates":null,"formatter":{"id":"522322"},"group":null,"major_label_policy":{"id":"522323"},"minor_tick_line_color":null,"ticker":{"id":"522294"}},"id":"522293","type":"LinearAxis"},{"attributes":{},"id":"522136","type":"Selection"},{"attributes":{"label":{"value":"Max Dd Dur. (1793 days)"},"renderers":[{"id":"522116"}]},"id":"522138","type":"LegendItem"},{"attributes":{"below":[{"id":"522289"}],"center":[{"id":"522292"},{"id":"522296"},{"id":"522330"},{"id":"522332"},{"id":"522351"}],"height":90,"left":[{"id":"522293"}],"min_border_bottom":6,"min_border_left":0,"min_border_right":10,"min_border_top":3,"outline_line_color":"#666666","renderers":[{"id":"522317"},{"id":"522337"}],"sizing_mode":"stretch_width","title":{"id":"522319"},"toolbar":{"id":"522305"},"toolbar_location":null,"width":null,"x_range":{"id":"521952"},"x_scale":{"id":"522285"},"y_range":{"id":"
